import React from 'react'
import Navbar from '../Components/Navbar'

function Wishlist(props) {
    let MyWishlist = props.Sh
  return (
    <>
    <Navbar/>
    <div className="wishBody">
        <div className="wishBodyListBody">
            <h1 className="WishTitleis">Wishlist</h1>
            {CartData.map((procar)=> (
          <>
          {/* <div className="clickProduct" onClick={()=>{openProduct(procar) }}></div> */}
          <Cartlist
              imgSrc={procar.thumbnail}
              title={procar.productName}
              price={procar.price}
              Qty={procar.stock}
              rate={procar.rate}
              ppv={procar.ppv}
              unit={procar.unit}
              />
              </>
            ))}
        </div>
    </div>
    </>
  )
}

export default Wishlist
